    [],nt"num_tags": 3,nt"name": "madison-wetlands-district-narrative-report-august-11-through-december-31-1969",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Madison
    Wetlands Management District outlines Refuge accomplishments during August through
    December of 1969. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover conditions during the year. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, fish, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, and
    vegetation control. Resource management is outlined; topics include grazing and
    fur harvesting. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, and safety. N-R forms, photographs,
    and newspaper articles are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
